import React from "react";

const PendingPartner = ({ partner, onApprove }) => {
  if (!partner) return null; // ðŸ›‘ Prevents crashes

  return (
    <div className="partner-card">
      <h3>{partner.name || "No Name"}</h3>

      <p><strong>Email:</strong> {partner.email || "N/A"}</p>
      <p><strong>Phone:</strong> {partner.phone || "N/A"}</p>

      <p>
        <strong>Categories Applied:</strong>{" "}
        {partner.categories && partner.categories.length > 0
          ? partner.categories.join(", ")
          : "No categories selected"}
      </p>

      {partner.address && <p><strong>Address:</strong> {partner.address}</p>}
      {partner.city && <p><strong>City:</strong> {partner.city}</p>}
      {partner.experience && <p><strong>Experience:</strong> {partner.experience} years</p>}

      <button 
        className="approve-btn"
        onClick={() => onApprove(partner.id)}
      >
        Approve Partner
      </button>
    </div>
  );
};

export default PendingPartner;
